script: |
  super -f tsv -I q821.sql > q821.out

vector: true

inputs:
  - name: q821.sql
    data: |
      SELECT c
      FROM t1
      WHERE d>e
      AND (a>b-2 AND a<b+2)
      AND c BETWEEN b-2 AND d+2
      ORDER BY 1;
  - name: t1

outputs:
  - name: q821.out
    data: |
      113
      134
      137
      166
      184
